                                            TrUserData).

d_field_new_password_request_new_password(<<1:1, X:7,
                                            Rest/binary>>,
                                          N, Acc, F@_1, F@_2, F@_3, TrUserData)
    when N < 57 ->
    d_field_new_password_request_new_password(Rest,
                                              N + 7,
                                              X bsl N + Acc,
                                              F@_1,
                                              F@_2,
                                              F@_3,
                                              TrUserData);
d_field_new_password_request_new_password(<<0:1, X:7,
                                            Rest/binary>>,
                                          N, Acc, F@_1, F@_2, _, TrUserData) ->
    {NewFValue, RestF} = begin
                             Len = X bsl N + Acc,
                             <<Bytes:Len/binary, Rest2/binary>> = Rest,
                             {id(binary:copy(Bytes), TrUserData), Rest2}
                         end,
    dfp_read_field_def_new_password_request(RestF,
                                            0,
                                            0,
                                            F@_1,
                                            F@_2,
                                            NewFValue,
                                            TrUserData).

