                                            F@_2,
                                            F@_3,
                                            TrUserData).

skip_group_new_password_request(Bin, FNum, Z2, F@_1,
                                F@_2, F@_3, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_new_password_request(Rest,
