verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        void -> v_msg_void(Msg, [MsgName], TrUserData);
        access_token ->
            v_msg_access_token(Msg, [MsgName], TrUserData);
        mqtt_auth_result ->
            v_msg_mqtt_auth_result(Msg, [MsgName], TrUserData);
        auth_request ->
            v_msg_auth_request(Msg, [MsgName], TrUserData);
        auth_response ->
            v_msg_auth_response(Msg, [MsgName], TrUserData);
        auth_token ->
            v_msg_auth_token(Msg, [MsgName], TrUserData);
        code -> v_msg_code(Msg, [MsgName], TrUserData);
        new_password_request ->
            v_msg_new_password_request(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_void/3}).
-dialyzer({nowarn_function,v_msg_void/3}).
v_msg_void(#{} = M, Path, TrUserData) ->
    case M of
        #{result := F1} ->
            v_type_string(F1, [result | Path], TrUserData);
        _ -> ok
    end,
    lists:foreach(fun (result) -> ok;
                      (OtherKey) ->
                          mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_void(M, Path, _TrUserData) when is_map(M) ->
    mk_type_error({missing_fields,
                   [] -- maps:keys(M),
                   void},
                  M,
                  Path);
v_msg_void(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, void}, X, Path).

