-compile({nowarn_unused_function,v_msg_auth_request/3}).
-dialyzer({nowarn_function,v_msg_auth_request/3}).
v_msg_auth_request(#{} = M, Path, TrUserData) ->
    case M of
        #{grant_type := F1} ->
            v_type_string(F1, [grant_type | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{app_id := F2} ->
            v_type_string(F2, [app_id | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{subjects := F3} ->
            if is_list(F3) ->
                   _ = [v_type_string(Elem, [subjects | Path], TrUserData)
                        || Elem <- F3],
                   ok;
               true ->
                   mk_type_error({invalid_list_of, string},
                                 F3,
                                 [subjects | Path])
            end;
        _ -> ok
    end,
    case M of
        #{client_id := F4} ->
            v_type_string(F4, [client_id | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{client_secret := F5} ->
            v_type_string(F5, [client_secret | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{phone := F6} ->
            v_type_string(F6, [phone | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{email := F7} ->
            v_type_string(F7, [email | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{username := F8} ->
            v_type_string(F8, [username | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{password := F9} ->
            v_type_string(F9, [password | Path], TrUserData);
        _ -> ok
